def pick_optimal(game, debug=False, pre_options=None):
    options = pre_options if pre_options is not None else game.getPossibleOptions()
    if debug:
        print("Dice:", game.dice)
    
    # (option, ratio, current_max, loss_diff, composite_metric)
    candidates = []
    for option in options.keys():
        current_max = max(options[option])
        ratio = current_max / MAX_SCORE[option]
        loss_diff = MAX_SCORE[option] - current_max
        metric = (current_max ** METRIC_EXP) / MAX_SCORE[option] * WEIGHTS[option]
        candidates.append((option, ratio, current_max, loss_diff, metric))
    
    best_ratio = max(candidates, key=lambda x: x[1])[1]
    if best_ratio < LOSS_THRESHOLD:
        best_loss_option = min(candidates, key=lambda x: x[3])[0]
        if debug:
            print(f"Option: {best_loss_option}, Score: {max(options[best_loss_option])}, Reason: Loss minimization")
        return best_loss_option
    
    best = max(candidates, key=lambda x: x[4])
    if debug:
        print(f"Option: {best[0]}, Score: {best[2]}, Ratio: {best[1]:.2f}, Reason: Optimal balance")
    return best[0]

