def run_games(runs, pick_strat, maxmax_pick_strat, debug=False, mini_debug=True):
    global g_cache
    global g_type_tally
    global g_total_hands
    if debug:
        print(f"Pick strat: {pick_strat.__name__}")
    scores = []
    for run in range(runs):
        x_order = copy.copy(X_ORDER)
        game = Game()
        while 0 in game.scores.values():
            g_cache.clear()
            game.rollDice()
            game.rollDice(maxmax(game.dice, 1, game, maxmax_pick_strat)[1])
            game.rollDice(maxmax(game.dice, 1, game, maxmax_pick_strat)[1])
            options = game.getPossibleOptions()
            save_state = game.saveState()
            game = Game()
            game.dice = save_state.dice
            tally_options = game.getPossibleOptions()
            g_total_hands += 1
            game.loadState(save_state)
            for option in tally_options.keys():
                if max(tally_options[option]) >= LOSS_THRESHOLD:
                    if option in g_type_tally.keys():
                        g_type_tally[option] += 1
                    else:
                        g_type_tally[option] = 1
            if len(options) == 0:
                game.scores[x_order[0]] = None
                x_order.remove(x_order[0])
            else:
                choice = pick_strat(game, debug)
                x_order.remove(choice)
                game.scores[choice] = max(options[choice])
            
        if mini_debug:
            print(f"Run: {run+1}/{runs}")
        if debug:
            print(f"Score: {game.getScore()}")
            print(f"{game.scores}")
            print(f"--------------------------------")
        scores.append(game.getScore())
    if mini_debug:
        print(f"Avg.    score: {sum(scores) / len(scores)}")
        print(f"Best    score: {max(scores)}")
        print(f"Worst   score: {min(scores)}")
    return sum(scores)/len(scores), max(scores), min(scores)

